import SwiftUI
import StoreKit

struct GamblingApp: View {
  @State private var coins: Int = 0
  @State private var bets: [Int] = []
  @State private var winnings: [Int] = []

  var body: some View {
    VStack {
      Text("Your Coins:")
      Text("Your Bets:")
      List(bets) { bet in
        Text("Bet \(bet)")
      }
      Text("Your Winnings:")
      List(winnings) { winnings in
        Text("Winning \(winnings)")
      }
    }
  }

  func makeBet() {
    let bet = Int.random(in: 1-100)
    bets.append(bet)
  }

  func collectWinnings() {
    let winnings = Int.random(in: 1-100)
    winnings.append(winnings)
  }
}

struct GamblingAppApp: App {
  @State private var coins: Int = 0
  @State private var bets: [Int] = []
  @State private var winnings: [Int] = []

  var body: some Scene {
    WindowGroup {
      GamblingApp()
    }
  }

  func makeBet() {
    let bet = Int.random(in: 1-100)
    bets.append(bet)
  }

  func collectWinnings() {
    let winnings = Int.random(in: 1-100)
    winnings.append(winnings)
  }
}
